import React from 'react'
import '../styles/SearchCard.css';

const SearchCard = (props) => {
    return(
        <div id="searchCard" onClick={() => props.onClick(props.id)}>
           {props.charity_name},
           <br/>
        </div>
    )
}
export default SearchCard
